import React from 'react';
import About from '././Navbar/About/About.js'; // Assuming About is also in the same folder as Navbar
import Navbar from '././Navbar/Navbar';
import Hero from './Navbar/Hero/Hero'; // Assuming Hero is in the same folder as Navbar

const App = () => {
  return (
    <div>
      <Navbar />
      <Hero />
      <About />
    </div>
  );
}

export default App;
